import React from 'react';
import Restaurant from "../components/Restaurant";
import { useNavigate } from "react-router-dom";
import Ilustration from '../images/illustration.svg'
const Login = () =>  {

  const navigate = useNavigate();

  const handleClick = () => {
    navigate('/roles')
  }

  return (
    <div className='login'>
        <Restaurant/>
        <img className="ilustration" src={Ilustration} alt='ilustration'></img>
        <h2>Login</h2>
        <div className='info'>
        <h3> Name </h3>
        <input className='input-form' type="text"/>
        <h3> Password </h3>
        <input className='input-form' name='pass' type="password"/>
        </div>
        <button className='input-login' onClick={handleClick}> Sign In  </button>
    </div>
  )
}

export default Login;
